import './index.scss';
import './styles/normalize.scss';
import './styles/header.scss';
import './styles/media.scss';
import './styles/utility.scss';
import './styles/main.scss';
import Header from './components/Header';

function App() {
  return (
  <>
    <Header/>
   <main className='main container'>
      <div className="main__top">
        <h1 className="main__top-title">Found Posts</h1>
        <div className="main__top-filter">Filter<img src='/svg/filter.svg' alt=""/></div>
      </div>
      <section className="main__cards">
        <div className="main__card">
          <img src="" alt="" className="main__card-img" />
          <div className="main__card-title"></div>
          <p className="main__card-description"></p>
          <div className="main__card-additional">
            <button>View</button>
            <div className="main__card-stat">
              <p>131</p>
              <p>09.06.2025</p>
            </div>
          </div>
        </div>
      </section>
   </main>
  </>


  );
};

export default App;
